"use client";

import { motion } from "framer-motion";
import { useInView } from "react-intersection-observer";
import { Button } from "@/components/ui/button";
import { Github, Calendar, Tag, Info } from "lucide-react";
import Image from "next/image";
import { useState } from "react";
import {
  Dialog,
  DialogContent,
  DialogDescription,
  DialogHeader,
  DialogTitle,
  DialogClose,
} from "@/components/ui/dialog";

export default function Projects() {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const [activeCategory, setActiveCategory] = useState("All");
  const [selectedProject, setSelectedProject] = useState(null);

  const projectCategories = [
    "All",
    "Full Stack Development",
    "AI & Machine Learning",
    "iOS Development",
    "Software Engineering",
    "IoT & Data Engineering",
  ];

  const projects = [
    {
      title: "GitHub Time-Series Forecasting",
      description: "Full-stack forecasting tool for GitHub repos",
      image: "/placeholder.svg",
      period: "Jan 2024 - Apr 2024",
      technologies: ["React", "Flask", "Google Cloud", "TensorFlow", "Prophet", "StatsModels", "Docker"],
      detailedPoints: [
        "Built a full-stack app to forecast GitHub metrics using LSTM, Prophet, and StatsModels.",
        "Hosted on Google Cloud using Dockerized microservices.",
        "Leveraged GCP services for data processing and scalable infrastructure."
      ],
      github: "https://github.com/yourusername/github-time-series",
      category: "Full Stack Development"
    },
    {
      title: "Currency Converter",
      description: "Flutter app with real-time exchange rates",
      image: "/placeholder.svg",
      period: "May 2024",
      technologies: ["Flutter", "Dart", "MVC", "REST API"],
      detailedPoints: [
        "Developed a Flutter app using OOP & MVC.",
        "Integrated REST API for real-time exchange rates.",
        "Designed with multi-screen navigation and good scalability."
      ],
      github: "https://github.com/yourusername/currency-converter",
      category: "Software Engineering"
    },
    {
      title: "Battleships",
      description: "Classic game developed in Flutter",
      image: "/placeholder.svg",
      period: "Apr 2024",
      technologies: ["Flutter", "API", "Mobile Game", "Real-time Updates"],
      detailedPoints: [
        "Created a mobile game with real-time game list view.",
        "Owned backend integration and optimized API endpoints.",
        "Ensured seamless user experience and efficient protocol handling."
      ],
      github: "https://github.com/yourusername/battleships",
      category: "Software Engineering"
    },
    {
      title: "Personal Portfolio Website",
      description: "React + Tailwind personal portfolio site",
      image: "/placeholder.svg",
      period: "Jun 2024",
      technologies: ["React", "Tailwind CSS", "Framer Motion", "JavaScript"],
      detailedPoints: [
        "Built this responsive portfolio using React, Tailwind & Framer Motion.",
        "Animated UI components, structured skill cards, and dark mode integration.",
        "Showcases personal work and highlights experience."
      ],
      github: "https://github.com/yourusername/portfolio",
      category: "Full Stack Development"
    },
  ];

  const filteredProjects =
    activeCategory === "All"
      ? projects
      : projects.filter((project) => project.category === activeCategory);

  const ProjectCard = ({ project, index }) => {
    return (
      <motion.div
        initial={{ opacity: 0, y: 30 }}
        animate={inView ? { opacity: 1, y: 0 } : { opacity: 0, y: 30 }}
        transition={{ duration: 0.5, delay: 0.15 * index }}
        className="bg-white rounded-xl shadow-md overflow-hidden project-card flex flex-col h-full"
      >
        <div className="relative h-48 w-full">
          <Image src={project.image || "/placeholder.svg"} alt={project.title} fill className="object-cover" />
          <div className="absolute top-3 right-3 bg-white/90 backdrop-blur-sm px-3 py-1 rounded-full text-xs font-medium flex items-center">
            <Tag className="h-3 w-3 mr-1 text-primary" />
            {project.category}
          </div>
        </div>
        <div className="p-6 flex-1 flex flex-col">
          <div className="flex items-center text-sm text-gray-500 mb-2">
            <Calendar className="h-4 w-4 mr-1" />
            <span>{project.period}</span>
          </div>
          <h3 className="text-xl font-bold mb-2">{project.title}</h3>
          <p className="text-gray-600 mb-4">{project.description}</p>

          <div className="flex flex-wrap gap-2 mb-4">
            {project.technologies.map((tech, i) => (
              <span key={i} className="px-2 py-1 skill-pill rounded-md text-xs font-medium">
                {tech}
              </span>
            ))}
          </div>

          <div className="mt-auto pt-4 flex gap-3">
            <a href={project.github} target="_blank" rel="noopener noreferrer">
              <Button variant="outline" size="sm" className="flex items-center gap-2">
                <Github className="h-4 w-4" />
                Code
              </Button>
            </a>
            <Button
              variant="outline"
              size="sm"
              className="flex items-center gap-2"
              onClick={() => setSelectedProject(project)}
            >
              <Info className="h-4 w-4" />
              Details
            </Button>
          </div>
        </div>
      </motion.div>
    );
  };

  return (
    <section id="projects" className="py-20 bg-gray-50">
      <div className="container mx-auto px-4 sm:px-6 lg:px-8">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-center mb-12"
        >
          <h2 className="text-3xl font-bold gradient-text">Projects</h2>
          <div className="mt-2 h-1 w-20 gradient-bg mx-auto"></div>
          <p className="mt-4 text-gray-600 max-w-2xl mx-auto">
            Here are some of the projects I've worked on that showcase my technical skills and problem-solving
            abilities.
          </p>
        </motion.div>

        <div className="flex justify-center mb-8 flex-wrap gap-2">
          {projectCategories.map((category) => (
            <Button
              key={category}
              variant={activeCategory === category ? "default" : "outline"}
              className={activeCategory === category ? "gradient-bg" : ""}
              onClick={() => setActiveCategory(category)}
            >
              {category}
            </Button>
          ))}
        </div>

        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {filteredProjects.map((project, index) => (
            <ProjectCard key={index} project={project} index={index} />
          ))}
        </div>
      </div>

      <Dialog open={selectedProject !== null} onOpenChange={(open) => !open && setSelectedProject(null)}>
        <DialogContent className="sm:max-w-lg">
          <DialogHeader>
            <DialogTitle className="text-xl font-bold">{selectedProject?.title}</DialogTitle>
            <DialogDescription className="text-primary font-medium">{selectedProject?.period}</DialogDescription>
          </DialogHeader>

          <div className="mt-4">
            <h4 className="font-medium mb-2">Technologies</h4>
            <div className="flex flex-wrap gap-2 mb-4">
              {selectedProject?.technologies.map((tech, i) => (
                <span key={i} className="px-2 py-1 skill-pill rounded-md text-xs font-medium">
                  {tech}
                </span>
              ))}
            </div>

            <h4 className="font-medium mb-2">Key Achievements</h4>
            <ul className="space-y-2 mb-4">
              {selectedProject?.detailedPoints.map((point, i) => (
                <li key={i} className="text-sm text-gray-600">
                  â€¢ {point}
                </li>
              ))}
            </ul>

            <div className="flex justify-between mt-6">
              <a href={selectedProject?.github} target="_blank" rel="noopener noreferrer">
                <Button variant="outline" size="sm" className="flex items-center gap-2">
                  <Github className="h-4 w-4" />
                  View Code
                </Button>
              </a>
              <DialogClose asChild>
                <Button variant="outline" size="sm">
                  Close
                </Button>
              </DialogClose>
            </div>
          </div>
        </DialogContent>
      </Dialog>
    </section>
  );
}
